export function PopupWithForm(props) {
    return (
        <div className={`popup popup-${props.name} ${props.isOpen ? 'popup_opened' : ''}`}>
            <div className="popup__container">
                <form onSubmit={props.onSubmit} className="form" name={`${props.name}`}>
                    <h2 className="form__title">{props.title}</h2>
                    {props.children}
                    <button on className="form__save-button" type="submit">Сохранить</button>
                </form>
                <button onClick={props.onClose} className="popup__close-button" type="button"></button>
            </div>
        </div>
    )
}
